import React from 'react';
import {Link} from 'react-router-dom';

const Nav = ({dogs}) => {
    // const animals = dogs.dogs
    console.log(dogs)

    return (
        <div>
            {dogs.map(data => (
                <Link to={`dogs/${data.name}`}>
                    {data.name}
                </Link>
            ))}
        </div>
    )
}

export default Nav;
